package com.example.customlistviewdemo;

import androidx.appcompat.app.AppCompatActivity;
import androidx.lifecycle.GenericLifecycleObserver;

import android.os.Bundle;
import android.widget.ListView;

public class MainActivity extends AppCompatActivity {
    ListView food;
    //Integer[] iurl={R.drawable.i1, R.drawable.i2, R.drawable.i3, R.drawable.i4, R.drawable.i5};
    String[] iurl = {"data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR7mUuhsUvzfbDg04Wnz16rxGK11txSw4k1gg&usqp=CAU"};
    String[] hdata = {"Dimple", "Siddhi", "DV", "Neeraj","Gauri"};
    String[] sdata = {"good", "good", "v good", "marv", "super"};

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        food = findViewById(R.id.food);
        //create  custom adapter
        MyAdapter ma = new MyAdapter(MainActivity.this, iurl, hdata, sdata);
        food.setAdapter(ma);
    }
}

